import { leadActions } from "./leads-slice"


export const getFields = () => {
    return async (dispatch) => {
        try {
            dispatch(leadActions.replaceLeads({
                fields: ["one","tow", "three"]
            }))
        } catch (error) {
            console.log(error);
        }

    }
}
